import React, { Component } from "react";
import withStyles from "@material-ui/core/styles/withStyles";
import { Grid } from "@material-ui/core/es";
import Csv from "../components/Csv";

const styles = {
  root: {
    flexGrow: 1,
    overflow: "hidden"
  },
  menu: {
    backgroundColor: "#ffffff",
    height: "100%"
  },
  rhsHeader: {
    backgroundColor: "#ffffff",
    height: "100%",
    alignItems: "center",
    display: "flex",
    marginLeft: "40px",
    fontSize: "20px",
    fontWeight: "bold",
    fontStyle: "normal",
    fontStretch: "normal",
    lineHeight: "0.92",
    letterSpacing: "1px",
    color: "#ffffff"
  },
  rhsMain: {
    backgroundColor: "#f4f4f4",
    padding: 30,
    height: "100%"
  },
  menuHeaderText: {
    color: "#ffffff",
    height: "100%",
    alignItems: "center",
    display: "flex",
    marginLeft: "40px",
    fontSize: "18px",
    fontWeight: "normal",
    fontStyle: "normal",
    fontStretch: "normal",
    lineHeight: "normal"
  },
  menuListItem: {
    height: "92%"
  }
};

class Cms extends Component {
  constructor(props) {
    super(props);
    this.state = {
      height: null,
      selectedItem: props.selectedItem ? props.selectedItem : 0,
      csvHeader: null,

    };
  }

  componentDidMount() {
    console.log("NOW WE TALK");
    this.resizeEvent();
    window.addEventListener("resize", () => this.resizeEvent());
  }

  resizeEvent() {
    this.setState({ height: window.innerHeight });
  }

  onSelectMenuItem = (key, selectedText) => {
    this.setState({ selectedItem: key, selectedText: selectedText });
  };

  render() {
    const { height } = this.state;
    const { classes } = this.props;

    return (
      <div className={classes.root}>
        <Grid container spacing={0} style={{ height: height }}>
          <Grid container style={{ height: "8%", backgroundColor: "#ffffff" }}>
            {"asd"}
          </Grid>
          <Grid container style={{ height: "92%" }}>
            <Grid item xs={2} style={{ height: "100%" }}>
              <div className={classes.menu}>
                <Grid container spacing={0} style={{ height: "8%" }}>
                  <Grid item xs={12}>
                    <div className={classes.menuHeaderText}>{" Menü "}</div>
                  </Grid>
                </Grid>
                <Grid container spacing={0} className={classes.menuListItem}>
                  <Grid item xs={12}>
                    {"dff"}
                  </Grid>
                </Grid>
              </div>
            </Grid>
            <Grid item xs={10} className={classes.rhsMain}>
              <Csv />
            </Grid>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default withStyles(styles)(Cms);
